drop SEQUENCE registration_seq;
drop table MAKE CASCADE CONSTRAINTS;
drop table MODEL CASCADE CONSTRAINTS;
drop table CATEGORY CASCADE CONSTRAINTS;
drop table DETAILED_MODEL CASCADE CONSTRAINTS;
drop table ENGINE_DISPLACEMENT CASCADE CONSTRAINTS;
drop table VEHICLE CASCADE CONSTRAINTS;
drop table ORDER_LIST CASCADE CONSTRAINTS;
drop table ACCOUNT CASCADE CONSTRAINTS;
drop table COLOR CASCADE CONSTRAINTS;
drop table TRANSMISSION CASCADE CONSTRAINTS;
drop table FUEL CASCADE CONSTRAINTS;

CREATE SEQUENCE registration_seq
start with 1
increment by 1
NOMAXVALUE
CACHE 200;

create table MAKE(
Make varchar(20) not null,
Country varchar(20) not null,
PRIMARY key (Make)
);

create table MODEL(
Model_name varchar(20) not null,
Make varchar(20) not null,
Category varchar(20) not null,
primary key (Model_name)
);

create table CATEGORY(
Category varchar(20) not null,
primary key (Category)
);

create table DETAILED_MODEL(
Detailed_model_name varchar(20) not null,
Model_name varchar(20) not null,
primary key (Detailed_model_name)
);

create table ENGINE_DISPLACEMENT(
Engine_displacement NUMBER not null,
Detailed_model_name varchar(20) not null,
primary key (Engine_displacement,Detailed_model_name)
);

create table VEHICLE(
Car_number VARCHAR(20) not null,
Registration_number NUMBER not null,
Price NUMBER,
Mileage NUMBER,
Model_year DATE,
Location VARCHAR(20),
Engine_displacement NUMBER not null,
Detailed_model_name VARCHAR(20) not null,
Color VARCHAR(15) not null,
Transmission VARCHAR(20) not null,
Fuel VARCHAR(20) not null,
primary key (Registration_number)
);

create table ORDER_LIST(
Registration_number NUMBER not null,
Seller_id VARCHAR(15) not null,
Buyer_id VARCHAR(15) not null,
Sell_date DATE,
primary key (Registration_number)
);

create table ACCOUNT(
Id VARCHAR(15) not null,
Password VARCHAR(15) not null,
Name VARCHAR(20) not null,
Phone_number VARCHAR(13) not null,
Address VARCHAR(100),
Bdate DATE,
Sex CHAR,
Job VARCHAR(20),
Account_type CHAR,
primary key (Id)
);

create table COLOR(
Color VARCHAR(15) not null,
primary key(Color)
);

create table TRANSMISSION(
Transmission VARCHAR(20) not null,
primary key(Transmission)
);


create table FUEL(
Fuel VARCHAR(20) not null,
primary key (Fuel)
);

alter table MODEL 
ADD CONSTRAINT Model_make_fk FOREIGN KEY (Make) 
REFERENCES Make(Make);

alter table MODEL
ADD CONSTRAINT Model_category_fk FOREIGN KEY (Category)
REFERENCES CATEGORY (Category);

alter table DETAILED_MODEL
ADD CONSTRAINT Dm_model_fk FOREIGN KEY (Model_name)
REFERENCES MODEL (Model_name);

alter table ENGINE_DISPLACEMENT
ADD CONSTRAINT Ed_dm_fk1 FOREIGN KEY (Detailed_model_name)
REFERENCES DETAILED_MODEL (Detailed_model_name);

alter table VEHICLE
ADD CONSTRAINT Vehicle_ed_fk FOREIGN KEY (Engine_displacement, Detailed_model_name)
REFERENCES ENGINE_DISPLACEMENT (Engine_displacement, Detailed_model_name);

alter table VEHICLE
ADD CONSTRAINT Vehicle_color_fk FOREIGN KEY (Color)
REFERENCES COLOR (Color);

alter table VEHICLE
ADD CONSTRAINT Vehicle_trans_fk FOREIGN KEY (Transmission)
REFERENCES TRANSMISSION (Transmission);

alter table VEHICLE
ADD CONSTRAINT Vehicle_fuel_fk FOREIGN KEY (Fuel)
REFERENCES FUEL (Fuel);

alter table ORDER_LIST
ADD CONSTRAINT Order_vehicle_fk FOREIGN KEY (Registration_number)
REFERENCES VEHICLE (Registration_number);

alter table ORDER_LIST
ADD CONSTRAINT Order_account_fk FOREIGN KEY (Seller_id)
REFERENCES ACCOUNT (Id);

alter table ORDER_LIST
ADD CONSTRAINT Order_account_id FOREIGN KEY (Buyer_id)
REFERENCES ACCOUNT (Id) ;




















alter table vehicle add (seller_id varchar(15) DEFAULT 'admin');

alter table vehicle
ADD CONSTRAINT vehicle_account_fk FOREIGN KEY (seller_id)
REFERENCES ACCOUNT (Id);

CREATE OR REPLACE VIEW ALL_VEHICLE_INFO AS 
     SELECT MK.MAKE, MK.COUNTRY, MD.MODEL_NAME, MD.CATEGORY, V.*
                           FROM VEHICLE V, DETAILED_MODEL DM, MODEL MD, MAKE MK
                           WHERE V.DETAILED_MODEL_NAME = DM.DETAILED_MODEL_NAME
                           AND DM.MODEL_NAME = MD.MODEL_NAME
                           AND mk.make = md.make;